<?php


namespace Fruitsbytes\PHP\MonCash\Button;

use Fruitsbytes\PHP\MonCash\API\APIException;
use Fruitsbytes\PHP\MonCash\API\Client;
use Fruitsbytes\PHP\MonCash\API\ClientException;
use Fruitsbytes\PHP\MonCash\API\Order;
use Fruitsbytes\PHP\MonCash\API\PaymentException;
use Fruitsbytes\PHP\MonCash\Configuration\Configuration;
use Fruitsbytes\PHP\MonCash\Configuration\ConfigurationException;
use Fruitsbytes\PHP\MonCash\Strategy\OrderIdGenerator\OrderIdGeneratorException;
use JetBrains\PhpStorm\ExpectedValues;

class ButtonStyleRedResponsive implements ButtonInterface
{

    const BORDER_L = "data:image/png;base64,";
    const BORDER_R = "data:image/png;base64,";
    const BACK = "data:image/png;base64,";
    private Configuration $configuration;


    /**
     * @param  Order  $order
     * @param  Configuration|array  $configuration
     * @param  bool  $border  Add border to button , default : true
     * @param  string  $lang  Button Internationalization variant , English,, French or Haitian Creole
     * @param  bool  $animateHover  Add animation to button on hover
     * @param  int  $height  Height of the button
     * @param  string  $type  Button type
     *
     * @throws OrderIdGeneratorException|ConfigurationException
     */
    public function __construct(
        public Order $order,
        Configuration|array $configuration = [],
        public bool $border = true,
        #[ExpectedValues(['en', 'fr', 'ht'])]
        public string $lang = 'en',
        public bool $animateHover = true,
        public int $height = 48,
        #[ExpectedValues(['submit', 'button'])]
        public string $type = 'submit'
    ) {
        $this->configuration = new Configuration($configuration);

        if (empty($this->order->id)) {
            $this->order->id = $this->configuration->orderIdGenerator->getNewID();
        }

    }

    public function html(): string
    {
        $id           = "id" . $this->order->id;
        $id_          = "#id".$this->order->id;
        $border       = $this->border ? '2px solid rgba(255, 0, 0, 0.68)' : 'none';
        $borderRadius = ($this->height / 2).'px';
        $ww           = $this->height * 155 / 253;
        $width        = ceil($this->height * 155 / 253)."px";
        $minWidth     = ceil((155 * 2 + 670) * $this->height / 253).'px';
        $shadow       = 10 * $this->height / 253;
        $height       = $this->height."px";
        $h            = ($this->height - 2)."px";
        $h2           = (ceil($this->height * 228 / 253))."px";
        $w3           = (ceil($this->height * 670 / 253))."px";
        $borderL      = self::BORDER_L;
        $back         = self::BACK;
        $borderR      = self::BORDER_R;
        $w2           = $ww * 2 ."px";
        $hover        = $this->animateHover ? "transform: scale(1.01); filter: drop-shadow(0 {$shadow}px {$shadow}px rgba(117, 0, 0, 0.86));" : '';

        $front = match ($this->lang) {
            "fr" => "data:image/png;base64,",
            "ht" => "data:image/png;base64,",
            default => "data:image/png;base64,"
        };

        return <<<BUTTON
            <style>
                $id_.monCash-button {
                    border: $border;
                    width: 100%;
                    min-width: $minWidth;
                    border-radius:  $borderRadius;
                    box-sizing: content-box;
                    height: $h;
                    display: inline-block;
                    cursor: pointer;
                    background: url('$borderL') left center no-repeat, url('$back') center no-repeat, url('$borderR') right center no-repeat;
                    background-size: $width $height, calc(100% - $w2)  $height, $width $height;
                }
            
                $id_.monCash-button:after {
                    content: '';
                    border: none;
                    width: inherit;
                    box-sizing: inherit;
                    min-width: inherit;
                    display: inherit;
                    height: inherit;
                    margin: 0;
                    border-radius: inherit;
                    background-image: url($front);
                    background-repeat: no-repeat;
                    background-position: center center;
                    background-size: $w3 $h2;
                }
            
                $id_.monCash-button:hover {
                    $hover
                }
            </style>
            
            <button class="monCash-button" id="$id"></button>
            
            BUTTON;

    }

    public function render(): void
    {
        echo $this->html();
    }

    public function __toString()
    {
        return $this->html();
    }

    /**
     * Get Url for redirection
     * @throws PaymentException
     * @throws ConfigurationException
     * @throws ClientException
     * @throws APIException
     */
    public function getUrl(){
         $client =  new Client( $this->configuration);

        return  $client->getRedirectUrlForOrder($this->order);
    }
}

?>

